import React from 'react'
import { Fab } from '@material-ui/core'
import { Component } from 'react'

export default class Onboard extends Component {
    constructor(props) {
        super(props);

    }
        render(){
            const handleClick = (e) => {
                localStorage.setItem('isSick', e);
            }
            const preventDefault = (event) => { event.preventDefault(); this.props.history.push('/alert') };
            return (
                <div className="Onboard">
                    <h1 className="title">MY COVID STORY</h1>
                    <div className="btn-group">
                        <Fab style={{ background: "#EA2027" }} variant="extended" className="fab sick-btn" onClick={() => {handleClick('sick');this.props.history.push('/alert')}}>
                            <span>I AM SICK</span>
                        </Fab>
                        <Fab style={{ background: "#0559FD" }} href="/confirm" variant="extended" className="fab not-sick-btn" onClick={() => handleClick('not sick')}>
                            <span>I AM NOT SICK</span>
                        </Fab>
                        <Fab style={{ background: "#0559FD" }} href="/confirm" variant="extended" className="fab not-sick-btn" onClick={() => handleClick('recovered')}>
                            <span>I AM RECOVERED</span>
                        </Fab>
                    </div>
                </div>
            )
        }
    }
